import React, { Component } from "react";
import { withStyles } from "@material-ui/core/styles";
import "./main.css";

const styles = theme => ({
  root: {}
});

class About extends Component {
  render() {
    const { classes } = this.props;
    return (
      <div className={classes.root}>
        <h1>Hello World</h1>
      </div>
    );
  }
}

export default withStyles(styles)(About);
